import React, { useEffect, useState } from "react";
import axios from "axios";

export default function GalleryItem(query) {
  const [queryResult, setQueryResult] = useState();

  useEffect(() => {
    axios.get(`http://localhost:8000/query/${query.query}`).then((res) => {
        setQueryResult(res.data);
        console.log()
    });
  }, [query.name, query.query]);
  return (
    <div className="galleryContainer">
      <div>
        <img className="galleryCardPhoto" src="./iphone.jpeg" alt="" />
      </div>
      <div className="galleryCardName">{query.query}</div>
      <div className="galleryCardPrice">$9999.99</div>
    </div>
  );
}
